mutation accountManagementRemoveAccount ( ) {
	accountManagement ( ) {
		removeAccount {
			accountInfoRemoveAccountPayload: accountInfo {
				id
				name
				description
				timeZone
				typeAccountInfo: type
				tenancyAccountInfo: tenancy
				auditAccountInfo: audit {
					createdBy
					createdTime
				}

				planAccountInfo: plan
				statusAccountInfo: status
			}
		}

	}	
}
